import React from 'react';
import '../css/pages.css'; // Import the CSS file
// import { Link } from 'react-scroll'; // Import Link from react-scroll

const Pages = () => {
  return (
    <div id="page" className="home-container">
      <div className="image-container">
        <img src="/img/sofa.jpg" alt="Image 1" className="left-image" />
        <img src="/img/bsofa.jpg" alt="Image 2" className="right-image" />
        <img src="/img/building.jpg" alt="Image 3" className="bottom-image" />
      </div>
    </div>
  );
};

export default Pages;
